import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { BusinessRouginComponent } from './business-rougin.component';

const routes: Routes = [{ path: '', component: BusinessRouginComponent }];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class BusinessRouginRoutingModule { }
